const ChannelBar = () => {
  return (
    <div className="flex shadow-lg w-80 h-screen ml-16 m-0 bg-gray-800 overflow-hidden">
        <div className="text-white w-80">
          <p className="text-center">WHITE</p>
          <div>
            <p className="pl-3">HI</p>
          </div>
        </div>
      </div>
  );
};

export default ChannelBar;
